import React, { useState, useEffect, useCallback } from 'react';
import { Menu, X, Sun, Moon } from 'lucide-react';
import { motion, AnimatePresence } from 'framer-motion';
import { useTheme } from '../context/ThemeContext';

const Header = ({ setCurrentPage, currentPage, scrollToProducts }) => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const { theme, toggleTheme } = useTheme();

  useEffect(() => {
    setIsMenuOpen(false); // Cierra el menú al cambiar de página
  }, [currentPage]);

  const handleMenuClick = useCallback(
    (item) => {
      if (item.name === 'Productos') {
        if (currentPage === 'home') {
          scrollToProducts();
        } else {
          setCurrentPage('home');
          setTimeout(() => scrollToProducts(), 300);
        }
      } else {
        setCurrentPage(item.page);
        if (item.page === 'home') window.scrollTo({ top: 0, behavior: 'smooth' });
      }
    },
    [currentPage, setCurrentPage, scrollToProducts]
  );

  const menuItems = [
    { name: 'Home', page: 'home' },
    { name: 'Productos', page: 'home' },
    { name: 'Contacto', page: 'contact' },
  ];

  return (
    <header className="fixed w-full z-50 backdrop-blur-md bg-white/70 dark:bg-gray-900/80 shadow-md transition-colors duration-500 ease-in-out">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8 flex items-center justify-between h-20">

        {/* Logo */}
        <motion.div
          whileHover={{ scale: 1.1 }}
          whileTap={{ scale: 0.95 }}
          className="text-2xl font-extrabold text-gray-900 dark:text-gray-100 cursor-pointer hover:text-amber-500 transition-colors duration-500"
          onClick={() => {
            setCurrentPage('home');
            window.scrollTo({ top: 0, behavior: 'smooth' });
          }}
        >
          Tienda
        </motion.div>

        {/* Navegación desktop */}
        <nav className="hidden md:flex items-center gap-8">
          {menuItems.map((item) => (
            <motion.button
              key={item.name}
              onClick={() => handleMenuClick(item)}
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.95 }}
              className={`font-semibold text-gray-900 dark:text-gray-200 relative transition-colors duration-500 ease-in-out focus:outline-none
                ${
                  currentPage === item.page
                    ? 'text-amber-400'
                    : 'hover:text-amber-400'
                }`}
            >
              {item.name}
            </motion.button>
          ))}
        </nav>

        {/* Botones: modo oscuro y menú móvil */}
        <div className="flex items-center gap-4 relative z-50">

          {/* Toggle tema */}
          <motion.div
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.9 }}
            className="p-2 rounded-full bg-gray-200 dark:bg-gray-800 text-gray-800 dark:text-gray-200 
              hover:bg-amber-400 dark:hover:bg-amber-500 hover:text-gray-900 dark:hover:text-gray-900 
              transition-all duration-500 ease-in-out shadow-sm cursor-pointer select-none"
            onClick={(e) => {
              e.preventDefault();
              e.stopPropagation();
              toggleTheme();
            }}
          >
            {theme === 'dark' ? <Sun size={20} /> : <Moon size={20} />}
          </motion.div>

          {/* Botón menú móvil */}
          <motion.button
            className="md:hidden p-2 rounded-full bg-gray-200 dark:bg-gray-800 text-gray-800 dark:text-gray-200 
              hover:bg-amber-400 dark:hover:bg-amber-500 transition-all duration-500 ease-in-out shadow-sm"
            onClick={() => setIsMenuOpen(!isMenuOpen)}
            whileTap={{ scale: 0.9 }}
          >
            {isMenuOpen ? <X size={24} /> : <Menu size={24} />}
          </motion.button>
        </div>
      </div>

      {/* Navegación móvil animada */}
      <AnimatePresence>
        {isMenuOpen && (
          <motion.nav
            initial={{ height: 0, opacity: 0 }}
            animate={{ height: 'auto', opacity: 1 }}
            exit={{ height: 0, opacity: 0 }}
            transition={{ duration: 0.4, ease: 'easeInOut' }}
            className="md:hidden bg-white/90 dark:bg-gray-900/90 backdrop-blur-md overflow-hidden shadow-md"
          >
            <div className="flex flex-col gap-4 p-4">
              {menuItems.map((item) => (
                <motion.button
                  key={item.name}
                  onClick={() => {
                    handleMenuClick(item);
                    setIsMenuOpen(false);
                  }}
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                  className="text-gray-900 dark:text-gray-200 font-semibold py-2 px-3 rounded-lg 
                  hover:bg-amber-100 dark:hover:bg-amber-500 transition-colors duration-500 ease-in-out focus:outline-none"
                >
                  {item.name}
                </motion.button>
              ))}
            </div>
          </motion.nav>
        )}
      </AnimatePresence>
    </header>
  );
};

export default Header;
